import { useState, useEffect } from "react";
import "./affordableLogo.css";

function AffordableLogo() {
  const [marginAnimate, setMargineAnimate] = useState(5);

  useEffect(() => {
    setMargineAnimate(16);
  });

  return (
    <div>
      <div className="affordableLogo" style={{ marginLeft: marginAnimate }} />
      <div
        className="affordableLogo"
        style={{ marginLeft: marginAnimate + 10 }}
      />
      <div className="affordableLogo" style={{ marginLeft: marginAnimate }} />
      <div
        className="affordableLogo"
        style={{ marginLeft: marginAnimate + 10 }}
      />
    </div>
  );
}

export default AffordableLogo;
